export const COLUMNS = [
  {
    Header: "Common Name",
    accessor: 'comName',
    Cell: (props) => {
      console.log(props.test)
      return(
        <td test2={props.test}>propstest</td>
      )
    }
    
    
  },
  {
      Header: "Scientific Name",
      accessor: 'sciName'
  },
  {
      Header: "Location",
      accessor: 'locName'
  },
  {
      Header: "Date",
      accessor: 'obsDt'
  }
];
